import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useNavigate,
} from "react-router-dom";
import "./style.css";
import UserDashboard from "./User_Dashboard.js";

const Navbar = () => {
  return (
    <div className="topnav">
      <Link to="/admin-login">Admin Login</Link>
      <Link to="/login-doctor">Doctor Login</Link>
      <Link to="/user-registration">Sign Up as User</Link>
      <Link to="/user-login" className="home">
        <img src="https://img.icons8.com/ios/50/000000/home.png" alt="Home" />
      </Link>
    </div>
  );
};

const updateFavicon = (faviconURL) => {
  const favicon = document.querySelector('link[rel="icon"]');
  if (favicon) {
    favicon.href = faviconURL;
  } else {
    const newFavicon = document.createElement("link");
    newFavicon.rel = "icon";
    newFavicon.href = faviconURL;
    document.head.appendChild(newFavicon);
  }
};

const updateWebpageTitle = (title) => {
  document.title = title;
};

const UserLogin = () => {
  const validateUserLogin = (event) => {};

  useEffect(() => {
    updateFavicon(
      //"https://cdn.iconscout.com/icon/free/png-512/free-user-1851010-1568997.png?f=webp&w=512"
      "https://cdn.iconscout.com/icon/free/png-512/free-user-employee-avatar-man-person-businessman-15-17179.png?f=webp&w=512"
    );
    updateWebpageTitle("User Login");
  }, []);

  return (
    <div>
      <Navbar />
      {/* <div className="login-container">
        <h2>User Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateUserLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div> */}
      <div
        style={{
          width: 1440,
          height: 1000,
          position: "relative",
          background: "white",
        }}
      >
        <div
          style={{
            width: 2610,
            height: 1013,
            left: -1308,
            top: -53,
            position: "absolute",
          }}
        >
          <div
            style={{
              width: 457,
              height: 131,
              left: 2153,
              top: 463,
              position: "absolute",
              textAlign: "right",
              color: "#3C3C3C",
              fontSize: 48,
              fontFamily: "Roboto",
              fontWeight: "700",
              lineHeight: 56,
              letterSpacing: 2.4,
              wordWrap: "break-word",
            }}
          >
            Save a Life, Donate
            <br />
            Blood Today!{" "}
          </div>
          <div
            style={{
              width: 2249.96,
              height: 1013,
              left: 0,
              top: 0,
              position: "absolute",
            }}
          >
            <div
              style={{
                width: 1297.38,
                height: 525.69,
                left: 0,
                top: 442.63,
                position: "absolute",
                boxShadow: "0px 4px 100px #ECE9E9",
              }}
            ></div>
            <div
              style={{
                width: 1425.96,
                height: 1013,
                left: 824,
                top: 0,
                position: "absolute",
                background: "linear-gradient(149deg, #280202 17%, #B32323 78%)",
                boxShadow: "0px 4px 4px #A5A4A4",
              }}
            ></div>
          </div>
        </div>
        <div
          style={{
            width: 1316,
            height: 71,
            left: 62,
            top: 52,
            position: "absolute",
          }}
        >
          <div
            style={{
              left: 529,
              top: 17,
              position: "absolute",
              color: "black",
              fontSize: 24,
              fontFamily: "Poppins",
              fontWeight: "400",
              wordWrap: "break-word",
            }}
          >
            Home
          </div>
          <div
            style={{
              left: 675,
              top: 17,
              position: "absolute",
              color: "black",
              fontSize: 24,
              fontFamily: "Poppins",
              fontWeight: "400",
              wordWrap: "break-word",
            }}
          >
            Find Blood
          </div>
          <div
            style={{
              width: 224,
              height: 71,
              left: 1092,
              top: 0,
              position: "absolute",
            }}
          >
            <div
              style={{
                width: 224,
                height: 71,
                left: 0,
                top: 0,
                position: "absolute",
                background: "white",
                borderRadius: 10,
                border: "2px black solid",
              }}
            />
            <div
              style={{
                width: 73,
                height: 37,
                left: 75,
                top: 20,
                position: "absolute",
                color: "black",
                fontSize: 25,
                fontFamily: "Roboto",
                fontWeight: "400",
                wordWrap: "break-word",
              }}
            >
              Log In
            </div>
          </div>
          <div
            style={{
              left: 873,
              top: 16,
              position: "absolute",
              color: "black",
              fontSize: 24,
              fontFamily: "Poppins",
              fontWeight: "400",
              wordWrap: "break-word",
            }}
          >
            Register Now
          </div>
          <div
            style={{
              width: 61,
              height: 62,
              left: 0,
              top: 1,
              position: "absolute",
            }}
          >
            <div
              style={{
                width: 61,
                height: 62,
                left: 0,
                top: 0,
                position: "absolute",
                background: "white",
                boxShadow: "0px 4px 100px 2px rgba(12.75, 12.75, 12.75, 0.25)",
                borderRadius: 9999,
              }}
            />
            <div
              style={{
                width: 23,
                height: 32,
                left: 19,
                top: 15,
                position: "absolute",
                border: "2px black solid",
              }}
            ></div>
          </div>
          <div
            style={{
              width: 72,
              height: 5,
              left: 529,
              top: 55,
              position: "absolute",
              background: "#4B4949",
            }}
          />
        </div>
      </div>
    </div>
  );
};

const AdminLogin = () => {
  const validateAdminLogin = (event) => {};
  useEffect(() => {
    updateFavicon(
      "https://cdn.iconscout.com/icon/premium/png-512-thumb/admin-1-32-687612.png?f=webp&w=512"
    );
    updateWebpageTitle("Admin Login");
  }, []);
  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>Admin Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateAdminLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const DoctorLogin = () => {
  const validateDoctorLogin = (event) => {};
  useEffect(() => {
    updateFavicon(
      "https://cdn.iconscout.com/icon/premium/png-512-thumb/doctor-567-1118047.png?f=webp&w=512"
    );
    updateWebpageTitle("Doctor Login");
  }, []);
  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>Doctor Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateDoctorLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const UserRegistration = () => {
  const [user, setUser] = useState({
    First_Name: "",
    Middle_Name: "",
    Last_Name: "",
    Username: "",
    Password: "",
    Email: "",
    Phone_No: "",
    Blood_Group: "",
    Last_Donation_Date: "",
  });

  const handleChange = (e) => {
    setUser((prev) => ({ ...prev, [e.target.name]: e.target.value }));
  };
  const Navigate = useNavigate();
  const handleRegistration = async (e) => {
    e.preventDefault();

    try {
      await axios.post("http://localhost:3000/user", user);
      Navigate("/user-login");
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    updateFavicon(
      "https://cdn.iconscout.com/icon/free/png-512/free-user-add-plus-contact-account-new-create-7-3318.png?f=webp&w=512"
    );
    updateWebpageTitle("User Registration");
  }, []);
  return (
    <div>
      <Navbar />
      <div className="login-container">
        <h2>User Registration</h2>
        <form id="registrationForm" onSubmit={handleRegistration}>
          <label htmlFor="registerFirstName" className="required">
            First Name:
          </label>
          <input
            type="text"
            id="register-firstName"
            onChange={handleChange}
            name="First_Name"
            required
          />
          <br />

          <label htmlFor="registerMiddleName">Middle Name:</label>
          <input
            type="text"
            id="register-middleName"
            onChange={handleChange}
            name="Middle_Name"
          />
          <br />

          <label htmlFor="registerLastName" className="required">
            Last Name:
          </label>
          <input
            type="text"
            id="register-lastName"
            onChange={handleChange}
            name="Last_Name"
            required
          />
          <br />

          <label htmlFor="registerUsername" className="required">
            Username:
          </label>
          <input
            type="text"
            id="register-username"
            onChange={handleChange}
            name="Username"
            required
          />
          <span id="usernameAvailability"></span>
          <br />

          <label htmlFor="registerPassword" className="required">
            Password:
          </label>
          <input
            type="password"
            id="register-password"
            onChange={handleChange}
            name="Password"
            required
          />
          <br />

          <label htmlFor="registerEmail" className="required">
            Email:
          </label>
          <input
            type="email"
            id="register-email"
            onChange={handleChange}
            name="Email"
            required
          />
          <br />
          <span id="emailAvailability"></span>
          <br />

          <label htmlFor="registerPhone" className="required">
            Phone Number:
          </label>
          <input
            type="tel"
            id="register-phone"
            name="Phone_No"
            onChange={handleChange}
            required
          />
          <br />
          <span id="telAvailability"></span>
          <br />

          <label htmlFor="registerBloodGroup" className="required">
            Blood Group:
          </label>
          <select
            id="register-bloodGroup"
            onChange={handleChange}
            name="Blood_Group"
          >
            <option value="A+">A+</option>
            <option value="A-">A-</option>
            <option value="B+">B+</option>
            <option value="B-">B-</option>
            <option value="O+">O+</option>
            <option value="O-">O-</option>
            <option value="AB+">AB+</option>
            <option value="AB-">AB-</option>
            <option value="Unknown">Unknown</option>
          </select>
          <br />

          <label htmlFor="registerLastDonationDate">Last Donation Date:</label>
          <input
            type="date"
            id="register-lastDonationDate"
            onChange={handleChange}
            name="Last_Donation_Date"
          />
          <p className="note">Leave empty if unsure</p>
          <button type="submit" id="registerButton">
            Register
          </button>
          <p className="note-asterisk">
            Note: Fields marked with{" "}
            <span style={{ fontSize: "1.2em" }}>(*)</span> are mandatory
          </p>
        </form>
      </div>
    </div>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/user-login" element={<UserLogin />} />
        <Route path="/admin-login" element={<AdminLogin />} />
        <Route path="/login-doctor" element={<DoctorLogin />} />
        <Route path="/user-registration" element={<UserRegistration />} />
        <Route path="/user-dashboard" element={<UserDashboard />} />
        {/* Set the default route to UserLogin */}
        <Route index element={<UserLogin />} />
      </Routes>
    </Router>
  );
};

export default App;
